import React, { useEffect, useState } from 'react';
import { MapContainer, TileLayer } from 'react-leaflet';
import L from 'leaflet';
import 'leaflet/dist/leaflet.css';
import './styles.css';

const MapComponent = () => {
    const [eeTiles, setEeTiles] = useState(null);

    useEffect(() => {
        const fetchTiles = async () => {
            try {
                const response = await fetch('http://localhost:5000/get-map-tiles');
                const data = await response.json();
                
                const tileUrl = `https://earthengine.googleapis.com/map/${data.mapid}/{z}/{x}/{y}?token=${data.token}`;
                setEeTiles(tileUrl);
                
            } catch (error) {
                console.error('Error fetching tiles:', error);
            }
        };

        fetchTiles();
    }, []);

    return (
        <div className="map-container">
            <MapContainer
                center={[33.6844, 73.0479]}
                zoom={10}
                style={{ height: '600px', width: '100%' }}
            >
                <TileLayer
                    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                    attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
                />
                
                {eeTiles && (
                    <TileLayer
                        url={eeTiles}
                        attribution="Google Earth Engine | Sentinel-2"
                        opacity={0.8}
                    />
                )}
            </MapContainer>
        </div>
    );
};

export default MapComponent;
